import React from "react";

import "./NavMenu.scss";
import blackCross from "../../assets/images/black-cross.png";

const NavMenu = props => {
  const { toggleSettings } = props;
  return (
    <div className="nav-menu">
      <div className="nav-menu__content">
        <img src={blackCross} alt="Close menu" className="nav-menu__cross" 
        onClick={toggleSettings}/>
        <h2 className="settings-menu__home">Home</h2>
        <h2 className="settings-menu__home">All Albums</h2>
        <h2 className="settings-menu__home">Rated Albums</h2>
      </div>
    </div>
  );
};

export default NavMenu;
